import React from "react"; //JSX
import App from "../App";
import ContactParticles from "./particles/ContactParticles";
 
export default function Contact(props) {
  return (
    <>
      <ContactParticles />
      <App />
      <div className="wrapper-form">
        <div className="box-form">

          <div className="item-form">
            <div className="label-form">Votre  Adresse  Email<span className="textNeeded-form">*</span></div> 
            <input type="text" className='textFields-form small' placeholder='truc@mail.com'></input>
          </div>

          <div className="item-form">
            <div className="label-form">Votre Message<span className="textNeeded-form">*</span></div>
            <textarea className='textArea-form' placeholder='Bonjour Monsieur PERRET,'></textarea>
          </div>

          <input type="submit" className="item-form button-form" value="Envoyer votre message"/> 
          {/* onclick={} */}

        </div>      
      </div>
    </>
  );
}
